export const setDifficultyLevel = (difficulty) => {
  return {
    type: "DIFFICULTY_LEVEL",
    payload: difficulty,
  };
};
export const setGameStatus = (status) => {
  return {
    type: "SET_GAME_STATUS",
    payload: status,
  };
};
